import React from 'react';

const EmployeeManagementPage = () => {
  return (
    <div className="min-h-screen bg-gray-100 flex">
      {/* Sidebar */}
      <div className="bg-gray-800 text-white w-64 flex-shrink-0">
        <div className="p-4">
          <h1 className="text-2xl font-bold">Employee Management</h1>
        </div>
        {/* Add more sidebar items as needed */}
        <ul className="space-y-2 p-4">
          <li className="hover:bg-gray-700 p-2 rounded">Dashboard</li>
          <li className="hover:bg-gray-700 p-2 rounded">Employees</li>
          <li className="hover:bg-gray-700 p-2 rounded">Tasks</li>
        </ul>
      </div>

      {/* Main Content */}
      <div className="flex-1 p-8">
        <h2 className="text-3xl font-bold mb-4">Welcome to Employee Management</h2>

        {/* Your main content goes here */}
        <div className="bg-white p-4 shadow rounded-lg">
          {/* Add your content components */}
          <p>Your content goes here.</p>
        </div>
      </div>
    </div>
  );
};

export default EmployeeManagementPage;
